function success(i,o){Lobibox.notify("success",{position:"top right",title:o,size:"mini",sound:!1,delay:20000,msg:i})}function error(i,o){Lobibox.notify("error",{position:"top right",title:o,size:"mini",sound:!1,delay:20000,msg:i})}function info(i,o){Lobibox.notify("info",{position:"top right",title:o,size:"mini",sound:!1,delay:20000,msg:i})}function warning(i,o){Lobibox.notify("warning",{position:"top right",title:o,size:"mini",sound:!1,delay:20000,msg:i})}